-- 导出  函数 jrtech.BASE_GETORGANIZATIONIDPATH 结构
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `BASE_GETORGANIZATIONIDPATH`(

p_orgId VARCHAR(100)

) RETURNS varchar(2000) CHARSET utf8
BEGIN

	DECLARE v_path VARCHAR(2000);

	DECLARE v_thisId VARCHAR(100);

	DECLARE v_parentId VARCHAR(100); 

	SELECT Id,parentId,id  INTO v_thisId ,v_parentId,v_path FROM Base_Organization WHERE Id = p_orgId;

	

 SET v_path = CONCAT('/',v_path);

	WHILE v_parentId IS NOT NULL && EXISTS(SELECT 1 FROM Base_Organization WHERE Id = v_parentId) DO

		SELECT Id,parentId INTO v_thisId ,v_parentId FROM Base_Organization WHERE Id = v_parentId ;

		SET v_path = CONCAT(v_path , '/' , v_thisId);

	END WHILE;

	

    SET v_path = CONCAT(v_path,'/');

    

    RETURN v_path;

	 

    

END//
DELIMITER ;

