CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `wf_v_todotask` AS select `a`.`ID_` AS `TASK_ID`,`a`.`PROC_INST_ID_` AS `PROC_INST_ID`,`a`.`TASK_DEF_KEY_` AS `ACT_ID`,`a`.`NAME_` AS `ACT_NAME`,`a`.`ASSIGNEE_` AS `ASSIGNEE`,`a`.`DELEGATION_` AS `DELEGATION_ID`,`a`.`DESCRIPTION_` AS `DESCRIPTION`,`a`.`CREATE_TIME_` AS `CREATE_TIME`,`a`.`DUE_DATE_` AS `DUE_DATE`,`i`.`USER_ID` AS `CANDIDATE`,`a`.`FORM_KEY_` AS `FORM_KEY` from (`jrtech`.`act_ru_task` `a` left join (select distinct `u`.`TASK_ID_` AS `TASK_ID_`,`u`.`USER_ID` AS `USER_ID` from (select `i`.`TASK_ID_` AS `TASK_ID_`,`i`.`USER_ID_` AS `USER_ID` from (`jrtech`.`act_ru_identitylink` `i` join `jrtech`.`act_ru_task` `t`) where ((`i`.`TASK_ID_` is not null) and (`i`.`USER_ID_` is not null) and (`i`.`TASK_ID_` = `t`.`ID_`) and isnull(`t`.`ASSIGNEE_`) and (`i`.`TYPE_` = 'candidate')) union select `i`.`TASK_ID_` AS `TASK_ID_`,`r`.`USER_ID_` AS `USER_ID` from ((`jrtech`.`act_ru_identitylink` `i` join `jrtech`.`act_id_membership` `r`) join `jrtech`.`act_ru_task` `t`) where ((`i`.`TASK_ID_` is not null) and (`i`.`GROUP_ID_` is not null) and (`i`.`TASK_ID_` = `t`.`ID_`) and isnull(`t`.`ASSIGNEE_`) and (`i`.`TYPE_` = 'candidate') and (`i`.`GROUP_ID_` = `r`.`GROUP_ID_`))) `u`) `i` on((`a`.`ID_` = `i`.`TASK_ID_`)));

/*!40101 SET SQL_MODE=IFNULL(@OLD_SQL_MODE, '') */;
/*!40014 SET FOREIGN_KEY_CHECKS=IF(@OLD_FOREIGN_KEY_CHECKS IS NULL, 1, @OLD_FOREIGN_KEY_CHECKS) */;
